INSERT INTO public.report_card VALUES (49, '2024-11-14 23:24:47.586722+00', '2024-11-14 23:24:47.586722+00', 'Nombre de stations pour 100 000 ha par région', NULL, 'map', '{"database":2,"type":"native","native":{"template-tags":{"region":{"type":"dimension","name":"region","id":"e0b43464-5d47-4ace-9e1a-3525328f6346","display-name":"Region","default":null,"dimension":["field",365,null],"widget-type":"string/contains","options":{"case-sensitive":false}}},"query":"WITH\r\n    i4 AS (  \r\n        SELECT\r\n            count(id_station_itinerance) AS nb_stat,\r\n            region.code\r\n        FROM\r\n            station \r\n            LEFT JOIN localisation ON localisation_id = localisation.id\r\n            LEFT JOIN city on city.code = code_insee_commune\r\n            LEFT JOIN department on city.department_id = department.id\r\n            LEFT JOIN region on department.region_id = region.id \r\n        WHERE {{region}}\r\n        GROUP BY\r\n            region.code\r\n        ORDER BY\r\n            nb_stat DESC\r\n    )\r\nSELECT\r\n    i4.nb_stat::float / region.population * 100000 AS nb_stat_pop,\r\n    region.code  \r\nFROM\r\n    i4\r\n    LEFT JOIN region on i4.code = region.code\r\nORDER by\r\n    nb_stat_pop DESC"}}', '{"map.region":"eb32b0c5-1ad0-c768-7941-be5e1ffb036f","map.dimension":"dpt_code","map.type":"region","map.longitude_column":"longitude","map.latitude_column":"latitude","map.metric":"nbre_pdc","table.cell_column":"puissance_nominale","map.colors":["rgb(218, 236, 251)","rgb(169, 202, 232)","rgb(119, 169, 213)","rgb(70, 135, 194)","hsl(208.29999999999995, 79.3%, 33.5%)"],"graph.series_order_dimension":null,"pie.sort_rows":false,"pie.rows":[{"key":"[0,15.0)","name":"[0,15.0)","originalName":"[0,15.0)","color":"#F9D45C","defaultColor":true,"enabled":true,"hidden":false,"isOther":false},{"key":"[15.0,26.0)","name":"[15.0,26.0)","originalName":"[15.0,26.0)","color":"#509EE3","defaultColor":true,"enabled":true,"hidden":false,"isOther":false},{"k