INSERT INTO public.report_card VALUES (44, '2024-11-14 23:14:35.887115+00', '2024-11-14 23:14:35.887115+00', 'Nombre de points de recharge selon la catégorie de puissance', NULL, 'pie', '{"database":2,"type":"native","native":{"template-tags":{"region":{"type":"dimension","name":"region","id":"e0b43464-5d47-4ace-9e1a-3525328f6346","display-name":"Region","default":null,"dimension":["field",365,null],"widget-type":"string/contains","options":{"case-sensitive":false}},"departement":{"type":"dimension","name":"departement","id":"2e858d20-e7d3-4c8f-89d6-d324b7826178","display-name":"Departement","default":null,"dimension":["field",283,null],"widget-type":"string/contains","options":{"case-sensitive":false}}},"query":"WITH \r\n    puissance(p_range, p_cat) AS (\r\n        VALUES \r\n            (numrange(0, 15.0), 1), \r\n            (numrange(15.0, 26.0), 2), \r\n            (numrange(26, 65.0), 3),\r\n            (numrange(65, 175.0), 4),\r\n            (numrange(175, 360.0), 5),\r\n            (numrange(360, NULL), 6)\r\n    )\r\nSELECT\r\n    count(id_pdc_itinerance) AS nb_pdc,\r\n    p_range\r\nFROM\r\n    pointdecharge \r\n    LEFT JOIN puissance ON puissance_nominale::numeric <@ p_range \r\n    LEFT JOIN station ON station.id = station_id \r\n    LEFT JOIN localisation ON localisation_id = localisation.id\r\n    LEFT JOIN city on city.code = code_insee_commune\r\n    LEFT JOIN department on city.department_id = department.id\r\n    LEFT JOIN region on department.region_id = region.id\r\nWHERE {{region}} [[AND {{departement}}]]\r\nGROUP BY\r\n    p_range"}}', '{"map.region":"eb32b0c5-1ad0-c768-7941-be5e1ffb036f","map.dimension":"dpt_code","map.type":"region","map.longitude_column":"longitude","map.latitude_column":"latitude","map.metric":"nbre_pdc","table.cell_column":"puissance_nominale","map.colors":["rgb(224, 245, 245)","rgb(183, 230, 230)","rgb(142, 215, 215)","rgb(101, 199, 199)","hsl(180, 51%, 41.9%)"],"pie.sort_rows":false,"pie.rows":[{"key":"[0,15.0)","name