INSERT INTO public.report_card VALUES (62, '2024-11-14 23:52:36.756151+00', '2024-11-14 23:52:36.756151+00', 'Répartition des points de recharge selon la catégorie de puissance nominale, par région', NULL, 'row', '{"database":2,"type":"native","native":{"template-tags":{"region":{"type":"dimension","name":"region","id":"ae24f070-2002-4a81-a494-aa23a9dcbc38","display-name":"Region","default":null,"dimension":["field",365,null],"widget-type":"string/contains","options":{"case-sensitive":false}},"operateur":{"type":"dimension","name":"operateur","id":"845bee54-55cb-4f05-af1d-5bed5a43ab35","display-name":"Operateur","default":null,"dimension":["field",329,null],"widget-type":"string/contains","options":{"case-sensitive":false}},"departement":{"type":"dimension","name":"departement","id":"63d36241-138c-4248-a9dc-06cd15721b50","display-name":"Departement","default":null,"dimension":["field",283,null],"widget-type":"string/contains","options":{"case-sensitive":false}}},"query":"WITH \r\n    puissance(p_range, p_cat) AS (\r\n        VALUES \r\n    (numrange(0, 7.3), 1), \r\n            (numrange(7.3, 22.0), 2), \r\n            (numrange(22, 50.0), 3),\r\n            (numrange(50, 150.0), 4),\r\n            (numrange(150, 350.0), 5),\r\n            (numrange(350, NULL), 6)\r\n    )\r\nSELECT\r\n    count(id_pdc_itinerance) AS nombre_de_pdc,\r\n    p_range,\r\n    region.name AS nom_de_region\r\nFROM\r\n    pointdecharge \r\n    LEFT JOIN station ON station.id = station_id \r\n    LEFT JOIN localisation ON localisation_id = localisation.id\r\n    LEFT JOIN city on city.code = code_insee_commune\r\n    LEFT JOIN department on city.department_id = department.id\r\n    LEFT JOIN region on department.region_id = region.id\r\n    LEFT JOIN puissance ON puissance_nominale::numeric <@ p_range \r\nWHERE {{operateur}} AND {{region}} [[AND {{departement}}]] \r\nGROUP BY\r\n    p_range,\r\n    region.name\r\nORDER BY\r\n    nombre_de_pdc DESC"}}', '{"map.region":"eb32b0c5-1ad0-c768-7941