INSERT INTO public.report_dashboardcard VALUES (82, '2024-11-15 10:41:10.778352+00', '2024-11-15 10:41:10.778352+00', 24, 6, 1, 0, NULL, 3, '[]', '{"virtual_card":{"name":null,"dataset_query":{},"display":"text","visualization_settings":{},"archived":false},"text":"La règlementation AFIR s''appuie sur quatre critères pour valider des tronçons routiers :\n- le réseau RTE-T : global ou central\n- le niveau de puissance des parcs de stations :\n  - 300 / 400 / 600 / 1 400 / 2 800 kW (avec une puissance supérieure à 150 kW ou 350 kW sur des points de recharge suivant les cas)  \n- le type de véhicule: léger / lourd\n- la distance inter-stations : 60 /  100 / 120 km\n"}', 'FYOEYv5Zvn8ZsvQxXzivd', NULL, 14);
