INSERT INTO public.report_dashboardcard VALUES (97, '2024-11-15 10:51:31.310554+00', '2024-11-15 10:51:31.310554+00', 24, 11, 0, 0, NULL, 3, '[]', '{"virtual_card":{"name":null,"dataset_query":{},"display":"text","visualization_settings":{},"archived":false},"text":"## modifications effectuées\n\n- titre : baromètre -> Open-data Qualicharge\n- exploration : ajout répartition AC / DC (DC si >= 50 ou CSS ou Chademo)\n- exploration : première section générale revue\n- exploration : suppression nb_pdc pour 100 000 ha\n- puissance : seuils 7.3, 22, 50, 150, 350\n- puissance : recréer histogramme\n- region : nbre_pdc pour 100 000 ha\n- region : ajout carte dpt pour 100 000 ha\n- recréer page afir\n\n## à faire\n\n- export : re-ajouter les attributs manquants\n- mettre à jour page usage avec les données sessions 2023\n- extraire les stations autoroutes et les croiser avec le reste\n- analyse pour identifier des types d''implantation plus pertinents\n- dashboard régions à créer (une page par région et vue département et ECPI)"}', 'mlfqowPHojx5-7rxJhb4K', NULL, 15);
